-- ----------------------------
-- Table structure for sys_enclosure
-- ----------------------------
DROP TABLE IF EXISTS `sys_enclosure`;
CREATE TABLE `sys_enclosure` (
  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `FILE_NAME` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '文件名称',
  `FILE_SUFFIX` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '文件后缀',
  `FILE_SIZE` int(11) DEFAULT NULL,
  `FILE_PATH` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '文件路径',
  `UPLOAD_DATE` datetime DEFAULT NULL COMMENT '上传时间',
  `CREATE_DATE` datetime DEFAULT NULL COMMENT '创建时间',
  `CREATE_USER_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '创建人',
  `MODIFY_DATE` datetime DEFAULT NULL COMMENT '修改时间',
  `MODIFY_USER_ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '修改人',
  `DELETE_STATE` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '删除状态，1为删除，0为未删除',
  `CODE` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `CONTENT_TYPE` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`ID`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of sys_enclosure
-- ----------------------------

-- ----------------------------
-- Table structure for sys_log
-- ----------------------------
DROP TABLE IF EXISTS `sys_log`;
CREATE TABLE `sys_log` (
  `ID` varchar(32) COLLATE utf8_bin NOT NULL COMMENT '主键',
  `USERNAME` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '用户名称',
  `OPERATION` varchar(50) COLLATE utf8_bin DEFAULT NULL COMMENT '用户操作',
  `METHOD` varchar(200) COLLATE utf8_bin DEFAULT NULL COMMENT '方法',
  `PARAMS` longtext COLLATE utf8_bin COMMENT '参数',
  `TIME` decimal(20,0) NOT NULL COMMENT '时长',
  `IP` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'IP地址',
  `CREATE_DATE` datetime(6) DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='系统日志表';

